import React, { useEffect } from "react";
import Card from 'react-bootstrap/Card';
import { useParams } from "react-router-dom";


function Projects() {
  let {profile} = useParams()
  const [data, setData] = useState("")
  useEffect(() => {
    fetch(`http://localhost:3001/${profile}`).then(res => res.json()).then(
        result => {
            setData(result)
        }
    ).catch(console.log);
  }, []);

  var addProjectCard = data['projects'].map((item) => {
    return (
      <div style = {{backgroundColor:'#ebebeb', padding: '12px', borderRadius: '10px', margin: '10px'}}>{item}</div>
  );
  });
  return (
      <div>
        <div style={{backgroundColor:'#d7d7d7', height:'100px'}}>
          <p style={{textAlign:'center', padding:'2%', fontWeight:'bold'}}>PROJECTS</p>
        </div>

       <div style={{paddingTop:'2%', textAlign: '-webkit-center'}}>
        <Card style={{ width: '60rem' , flexDirection:'row', margin: '3% 0%'}}>
        <Card.Img src="/assets/image.png" class="card-img-top" style={{width:'30%'}}alt="project"/>
          <Card.Body>
          <Card.Title>Card Title</Card.Title>
          <Card.Text>
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </Card.Text>
          <Card.Link href="#">Card Link</Card.Link>
          <Card.Link href="#">Another Link</Card.Link>
          </Card.Body>
        </Card>

        <Card style={{ width: '60rem' , flexDirection:'row', borderBlockColor:'none', margin: '3% 0%'}}>
        <Card.Img src="/assets/image.png" class="card-img-top" style={{width:'30%'}}alt="project"/>
          <Card.Body>
          <Card.Title>Card Title</Card.Title>
          <Card.Text>
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </Card.Text>
          <Card.Link href="#">Card Link</Card.Link>
          <Card.Link href="#">Another Link</Card.Link>
          </Card.Body>
        </Card>
      </div>
    </div>
  );
}

export default Projects;
